import React from 'react'
import ChatRoom from './components/ChatRoom'
import Home from './components/Home';
import Routes from 'router'


const App = () => {
  return (
    <Routes>
      <Home path="/" elem />
      <ChatRoom path="/chatroom" />
    </Routes>
  )
}

export default App;
